from typing import List, Dict
from aiohttp import web

from openapi_server.models.item_priority_response import ItemPriorityResponse
from openapi_server import util


async def get_item_priority_feed(request: web.Request, accept, x_ebay_c_marketplace_id, range, category_id, _date) -> web.Response:
    """get_item_priority_feed

    &lt;p&gt;Using this method, you can download a TSV_GZIP (tab separated value gzip) &lt;b&gt;Item Priority&lt;/b&gt; feed file, which allows you to track changes (deltas) in the status of your priority items, such as when an item is added or removed from a campaign.  The delta feed tracks the changes to the status of items within a category you specify in the input URI. You can also specify a specific date for the feed you want returned.&lt;/p&gt;&lt;p&gt;&lt;span class&#x3D;\&quot;tablenote\&quot;&gt;&lt;span style&#x3D;\&quot;color:#FF0000\&quot;&gt; &lt;b&gt; Important:&lt;/b&gt; &lt;/span&gt; You must consume the daily feeds (&lt;b&gt;Item&lt;/b&gt;, &lt;b&gt;Item Group&lt;/b&gt;) before consuming the &lt;b&gt;Item Priority&lt;/b&gt; feed. This ensures that your inventory is up to date.&lt;/span&gt;&lt;/p&gt;&lt;h3&gt;&lt;b&gt;Downloading feed files &lt;/b&gt;&lt;/h3&gt;             &lt;p&gt;&lt;span class&#x3D;\&quot;tablenote\&quot;&gt;&lt;b&gt;Note: &lt;/b&gt; Filters are applied to the feed files. For details, see &lt;a href&#x3D;\&quot;/api-docs/buy/static/api-feed.html#feed-filters\&quot;&gt;Feed File Filters&lt;/a&gt;. When curating the items returned, be sure to code as if these filters are not applied as they can be changed or removed in the future.&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Priority Item feed files are binary gzip files. If the file is larger than 100 MB, the download must be streamed in chunks. You specify the size of the chunks in bytes using the &lt;a href&#x3D;\&quot;#range-header\&quot;&gt;Range&lt;/a&gt; request header. The &lt;a href&#x3D;\&quot;#content-range\&quot;&gt;Content-range&lt;/a&gt; response header indicates where in the full resource this partial chunk of data belongs  and the total number of bytes in the file.       For more information about using these headers, see &lt;a href&#x3D;\&quot;/api-docs/buy/static/api-feed_beta.html#retrv-gzip\&quot;&gt;Retrieving a gzip feed file&lt;/a&gt;.    &lt;/p&gt;    &lt;p&gt;In addition to the API, there is an open source &lt;a href&#x3D;\&quot;https://github.com/eBay/FeedSDK\&quot; target&#x3D;\&quot;_blank\&quot;&gt;Feed SDK&lt;/a&gt; written in Java that downloads, combines files into a single file when needed, and unzips the entire feed file. It also lets you specify field filters to curate the items in the file.&lt;/p&gt;              &lt;p&gt;&lt;span class&#x3D;\&quot;tablenote\&quot;&gt;  &lt;b&gt; Note:&lt;/b&gt;  A successful call will always return a TSV.GZIP file; however, unsuccessful calls generate errors that are returned in JSON format. For documentation purposes, the successful call response is shown below as JSON fields so that the value returned in each column can be explained. The order of the response fields shows the order of the columns in the feed file.&lt;/span&gt;  &lt;/p&gt;                &lt;h3&gt;&lt;b&gt;Restrictions &lt;/b&gt;&lt;/h3&gt;                &lt;p&gt;For a list of supported sites and other restrictions, see &lt;a href&#x3D;\&quot;/api-docs/buy/feed/overview.html#API\&quot;&gt;API Restrictions&lt;/a&gt;.&lt;/p&gt;

    :param accept: The formats that the client accepts for the response.&lt;br&gt;&lt;br&gt;A successful call will always return a TSV.GZIP file; however, unsuccessful calls generate error codes that are returned in JSON format.&lt;br&gt;&lt;br&gt;&lt;b&gt;Default:&lt;/b&gt; &lt;code&gt;application/json,text/tab-separated-values&lt;/code&gt;
    :type accept: str
    :param x_ebay_c_marketplace_id: The ID of the eBay marketplace where the item is hosted. &lt;b&gt;Note: &lt;/b&gt; This value is case sensitive.&lt;br&gt;&lt;br&gt;For example: &lt;br&gt;&amp;nbsp;&amp;nbsp;&lt;code&gt;X-EBAY-C-MARKETPLACE-ID &#x3D; EBAY_US&lt;/code&gt;  &lt;br&gt;&lt;br&gt; For a list of supported sites see, &lt;a href&#x3D;\&quot;/api-docs/buy/static/ref-marketplace-supported.html\&quot;&gt;Buy API Support by Marketplace&lt;/a&gt;.
    :type x_ebay_c_marketplace_id: str
    :param range: Header specifying content range to be retrieved. Only supported range is bytes.&lt;br&gt; &lt;br&gt;&lt;b&gt;Example&lt;/b&gt; : &lt;code&gt;bytes &#x3D; 0-102400&lt;/code&gt;.
    :type range: str
    :param category_id: An eBay top-level category ID of the items to be returned in the feed file.&lt;br&gt; &lt;br&gt;The list of eBay category IDs changes over time and category IDs are not the same across all the eBay marketplaces. To get a list of the top-level categories for a marketplaces, you can use the Taxonomy API &lt;a href&#x3D;\&quot;/api-docs/commerce/taxonomy/resources/category_tree/methods/getCategoryTree\&quot;&gt;getCategoryTree&lt;/a&gt; method. This method retrieves the complete category tree for the marketplace. The top-level categories are identified by the &lt;b&gt;categoryTreeNodeLevel&lt;/b&gt; field.&lt;br&gt;&lt;br&gt;&lt;b&gt;For example:&lt;/b&gt;&lt;br&gt;&amp;nbsp;&amp;nbsp;&lt;code&gt;\&quot;categoryTreeNodeLevel\&quot;: 1&lt;/code&gt; &lt;br&gt;&lt;br&gt;For details see &lt;a href&#x3D;\&quot;/api-docs/buy/api-feed.html#Getcat\&quot;&gt;Get the eBay categories of a marketplace&lt;/a&gt;.&lt;/li&gt;&lt;/ul&gt;&lt;br&gt;&lt;br&gt;&lt;b&gt;Restriction:&lt;/b&gt; Must be a top-level category other than Real Estate. Items listed under Real Estate L1 categories are excluded from all feeds in all marketplaces.
    :type category_id: str
    :param _date: The date of the feed you want returned. This can be up to 14 days in the past but cannot be set to a date in the future.&lt;br&gt; &lt;br&gt;&lt;b&gt;Format:&lt;/b&gt; &lt;code&gt;yyyyMMdd&lt;/code&gt;&lt;br &gt;&lt;br&gt;&lt;span class&#x3D;\&quot;tablenote\&quot;&gt; &lt;b&gt;Note: &lt;/b&gt;&lt;ul&gt;  &lt;li&gt;The daily &lt;b&gt;Item&lt;/b&gt; feed files are available each day after 9AM MST (US Mountain Standard Time), which is -7 hours UTC time.&lt;/li&gt;    &lt;li&gt;There is a 48 hour latency when generating the &lt;b&gt; Item&lt;/b&gt; feed files. This means you can download the file for July 10th on July 12 after 9AM MST. &lt;br&gt;&lt;br&gt;&lt;b&gt;Note: &lt;/b&gt; For categories with a large number of items, the latency can be up to 72 hours.&lt;/li&gt; &lt;/ul&gt;&lt;/span&gt;
    :type _date: str

    """
    return web.Response(status=200)
